import React, { useState } from 'react'
import { FileUploader } from "react-drag-drop-files";
import './common.css'

const fileTypes = ["JPG", "PNG"];

const Cartoonify = () => {
	const [file, setFile] = useState(null);
  	const handleChange = (file) => {
		const imgObjUrl = URL.createObjectURL(file);
		console.log(imgObjUrl)
    	setFile(file);
  	};

	function sendCartoonifyRequest() {
		const formData = new FormData();
    	formData.append(file.name + "" + Date.now(), file);
	}

	return (
		<div className=''>
		<FileUploader 
					  name="file" 
					  types={fileTypes}
					  hoverTitle="Drop here"
					  handleChange={handleChange} 
					  onTypeError={(err) => { window.alert(err) }}
					  onSizeError={(err) => { window.alert(err) }} />
		{ file != null ? <p>{URL.createObjectURL(file)}</p> : null}
		</div>
	);
};

export default Cartoonify;
